<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>Interstellar</title>

  <link rel="preconnect" href="https://fonts.googleapis.com">
  <link rel="preconnect" href="https://fonts.gstatic.com" crossorigin>
  <link href="https://fonts.googleapis.com/css2?family=DM+Serif+Display:ital@0;1&family=Playfair+Display:ital@0;1&display=swap" rel="stylesheet">

  <style>
    :root{
      --bg-black: #191f25;
      --ship-color: #cfcfcf;
      --glow-color: #ffffc1;
    }

    body{
      background-color: var(--bg-black);
      color: #fff;
      overflow-y: hidden;
    }

    /* Text */

    h2{
      font-family: "DM Serif Display", serif;
      font-weight: 100;
      letter-spacing: 3px;
      font-size: 1.5em;
    }

    h3{
      font-family: "DM Serif Display", serif;
      font-weight: 100;
      letter-spacing: 3px;
      font-size: 0.8em;
      margin-left: 20px;
    }

    p{
      font-family: "DM Serif Display", serif;
      font-weight: 100;
      letter-spacing: 3px;
      font-size: 1em;
    }

    /* Movie information */

    .info{
      z-index: 1;
      display: flex;
      flex-direction: column;
      align-items: flex-end;
      position: absolute;
      bottom: 0;
      right: 1vw;
    }

    .logo svg{
      height: 15vh;
      width: auto;
    }

    .actors{
      text-align: right;
      display: flex;
    }

    /* Spaceship and quote */

    .endurance{
      position: absolute;
      top: 31vh;
      right: 15vw;
      display: flex;
      width: 13vw;
      min-width: 250px;
      justify-content: space-between;
      align-items: center;
    }

    .endurance svg{
      width: auto;
      min-width: 50px;
      max-width: 100px;
      animation: rotate 3s linear infinite;
    }

    @keyframes rotate {
      0% {
        transform: rotate(0deg);
      }
      100% {
        transform: rotate(360deg);
      }
    }

    /* Black hole */
    
    .gargantua_inst, 
    .gargantua_bg{
      z-index: 1;
      position: absolute;
      top: -5vh;
      left: -20vw;
      transform: rotateZ(-15deg);
    }

    .gargantua_inst svg , 
    .gargantua_bg svg{
      width: 100vw;
      height: auto;
    }

    .gargantua_bg{
      color: var(--glow-color);
      filter: blur(20px);
      opacity: 0.5;
      animation: glow 0.6s linear infinite;
    }

    @keyframes glow {
      0% {
        opacity: 0.8;
      }
      50% {
        opacity: 0.7;
      }
      100% {
        opacity: 0.8;
      }
    }

    .gargantua_circle svg{
      width: 45vw;
      height: auto;
      fill: var(--bg-black);
    }

    .gargantua_circle{
      position: absolute;
      left: 5vw;
    }

    /* Black hole sprite animation */

    #fr1{
      animation: k1 2s infinite;
    }

    #fr2{
      animation: k2 2s infinite;
    }

    #fr3{
      animation: k3 2s infinite;
    }

    #fr4{
      animation: k4 2s infinite;
    }

    #fr5{
      animation: k5 2s infinite;
    }

    @keyframes k1{
      0%{
        opacity: 1;
      }
      24.99%{
        opacity: 1;
      }
      25%{
        opacity: 0;
      }
      50%{
        opacity: 0;
      }
      75%{
        opacity: 0;
      }
      100%{
        opacity: 0;
      }
    }

    @keyframes k2{
      0%{
        opacity: 0;
      }
      24.99%{
        opacity: 0;
      }
      25%{
        opacity: 1;
      }
      49.99%{
        opacity: 1;
      }
      50%{
        opacity: 0;
      }
      75%{
        opacity: 0;
      }
      100%{
        opacity: 0;
      }
    }

    @keyframes k3{
      0%{
        opacity: 0;
      }
      25%{
        opacity: 0;
      }
      49.99%{
        opacity: 0;
      }
      50%{
        opacity: 1;
      }
      74.99%{
        opacity: 1;
      }
      75%{
        opacity: 0;
      }
      100%{
        opacity: 0;
      }
    }

    @keyframes k4{
      0%{
        opacity: 0;
      }
      25%{
        opacity: 0;
      }
      50%{
        opacity: 0;
      }
      74.99%{
        opacity: 0;
      }
      75%{
        opacity: 1;
      }
      99.99%{
        opacity: 1;
      }
      100%{
        opacity: 0;
      }
    }

    @keyframes k5{
      0%{
        opacity: 0;
      }
      25%{
        opacity: 0;
      }
      50%{
        opacity: 0;
      }
      75%{
        opacity: 0;
      }
      99.99%{
        opacity: 0;
      }
      100%{
        opacity: 1;
      }
    }

    /* Stars */

    .stars circle{
      fill: #fff;
    }

    .stars{
      position: absolute;
      top: 0;
      left: 0;
      width: 100vw;
      height: 100vh;
      z-index: -1;
    }

  </style>
</head>

<script>
  function getRandomNumber(min, max) {
    return Math.random() * (max - min) + min;
  }

  function getRandomPosition(canvasWidth, canvasHeight) {
    var x = getRandomNumber(0, canvasWidth);
    var y = getRandomNumber(0, canvasHeight);
    return { x: x, y: y };
  }

  var svg = document.querySelector('.stars');
  var canvasWidth = svg.clientWidth;
  var canvasHeight = svg.clientHeight;

  for (var i = 0; i < 100; i++) {
    var radius = getRandomNumber(0.5, 1);
    var position = getRandomPosition(canvasWidth, canvasHeight);

    var circle = document.createElementNS('http://www.w3.org/2000/svg', 'circle');
    circle.setAttribute('cx', position.x);
    circle.setAttribute('cy', position.y);
    circle.setAttribute('r', radius);
    circle.setAttribute('fill', 'white');

    svg.appendChild(circle);
  }
</script>
